#include "inc.h"


class Solution {
    vector<vector<int>> dirs = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
    int m, n;
    vector<vector<bool>> visited;
public:
    bool hasPath(vector<vector<int>>& maze, vector<int>& start, vector<int>& destination) {
        if(maze.empty() || maze[0].empty()){
            return false;
        }
        m = (int)maze.size();
        n = (int)maze[0].size();
        visited.assign(m, vector<bool>(n, false));
        return DFS(maze, start, destination);
    }
    bool DFS(vector<vector<int>>& maze, vector<int> current, vector<int>& destination){
        //cout << current[0] << " " << current[1] << endl;
        if(current == destination){
            return true;
        }
        int i = current[0], j = current[1];
        if(!visited[i][j]){
            visited[i][j] = true;
            for(int k = 0; k < 4; ++k){
                vector<int> next = goToEnd(maze, current, dirs[k]);
                if(DFS(maze, next, destination)){
                    return true;
                }
            }
        }
        return false;
    }
    vector<int> goToEnd(vector<vector<int>>& maze, vector<int> current, vector<int> dir){
        int i = current[0], j = current[1];
        while(i + dir[0] >= 0 && i + dir[0] < m && j + dir[1] >= 0 && j + dir[1] < n && maze[i + dir[0]][j + dir[1]] == 0){
            i += dir[0];
            j += dir[1];
        }
        current = {i, j};
        return current;
    }
};


